double pow_float(double base, double exp) {
  double result = 1.0;
  int i = 0;
  int e = (exp).toInt();
  while (i < e) {
    result = result * base;
    i = i + 1;
  }
  return result;
}

double apply_op(double a, double b, String op) {
  if (op == "+") {
    return a + b;
  }
  if (op == "-") {
    return a - b;
  }
  if (op == "*") {
    return a * b;
  }
  if (op == "/") {
    return a / b;
  }
  if (op == "^") {
    return pow_float(a, b);
  }
  return 0.0;
}

